import React from "react";
import styled from "styled-components";

const RED   = "#D71A28";
const INK   = "#111827";
const GRAY  = "#6b7280";
const BG    = "#F5F7FA";
const SOFT  = "#eef2f7";

const Wrap = styled.div`
  max-width: 980px;
  margin: 22px auto;
  padding: 0 18px 28px;
`;

const Hero = styled.header`
  background: linear-gradient(180deg, #fff, ${BG});
  border: 1px solid ${SOFT};
  border-radius: 18px;
  padding: 22px 22px 18px;
  box-shadow: 0 10px 26px rgba(16,24,40,.06);
`;

const Badge = styled.span`
  display: inline-block;
  font-size: 12px;
  font-weight: 800;
  letter-spacing: .14em;
  text-transform: uppercase;
  color: ${GRAY};
`;

const Title = styled.h1`
  margin: 6px 0 4px;
  font-size: 32px;
  line-height: 1.15;
  color: ${INK};
  font-weight: 900;
`;

const Underline = styled.div`
  width: 72px;
  height: 3px;
  border-radius: 999px;
  background: linear-gradient(90deg, ${RED}, #9ca3af);
  opacity: .9;
  margin: 8px 0 4px;
`;

const Sub = styled.p`
  margin: 0;
  color: ${GRAY};
  font-size: 14px;
`;

const Grid = styled.section`
  display: grid;
  grid-template-columns: 1fr;
  gap: 16px;
  margin-top: 18px;
`;

const Card = styled.article`
  background: #fff;
  border: 1px solid ${SOFT};
  border-radius: 16px;
  padding: 18px 20px;
  box-shadow: 0 8px 20px rgba(16,24,40,.06);
`;

const H3 = styled.h3`
  margin: 0 0 10px;
  font-size: 18px;
  color: ${INK};
  font-weight: 800;
`;

const P = styled.p`
  margin: 6px 0 0;
  color: ${INK};
  line-height: 1.6;
`;

const Muted = styled.p`
  margin: 6px 0 0;
  color: ${GRAY};
  line-height: 1.6;
`;

const Mail = styled.a`
  color: ${RED};
  text-decoration: none;
  &:hover { text-decoration: underline; }
`;

export default function Legal() {
  const last = new Date().toLocaleDateString("fr-FR");
  return (
    <Wrap>
      <Hero>
        <Badge>Mentions légales</Badge>
        <Title>Mentions légales</Title>
        <Underline />
        <Sub>Dernière mise à jour&nbsp;: {last}</Sub>
      </Hero>

      <Grid>
        <Card>
          <H3>Éditeur</H3>
          <P><strong>Redal Digital</strong> – SARL au capital de XX XXX MAD</P>
          <Muted>Siège&nbsp;: 00, Rue Exemple, Casablanca, Maroc</Muted>
          <Muted>ICE&nbsp;: XXXXXXX – IF&nbsp;: XXXX – RC&nbsp;: XXXXX</Muted>
        </Card>

        <Card>
          <H3>Directeur de publication</H3>
          <P>M. / Mme …</P>
        </Card>

        <Card>
          <H3>Hébergeur</H3>
          <P>Nom de l’hébergeur – Adresse – Téléphone</P>
        </Card>

        <Card>
          <H3>Contact</H3>
          <P>Email&nbsp;: <Mail href="mailto:support@votredomaine.com">support@votredomaine.com</Mail></P>
        </Card>

        <Card>
          <H3>Propriété intellectuelle</H3>
          <Muted>
            Les marques, logos, textes et contenus de ce site sont protégés. Toute reproduction est interdite sans autorisation.
          </Muted>
        </Card>

        <Card>
          <H3>Responsabilité</H3>
          <Muted>
            Nous nous efforçons d’assurer l’exactitude des informations. Nous ne pouvons être tenus responsables des contenus de sites tiers.
          </Muted>
        </Card>

        <Card>
          <H3>Cookies</H3>
          <Muted>
            Voir la <a href="/privacy">Politique de confidentialité</a> pour plus d’informations.
          </Muted>
        </Card>

        <Card>
          <H3>Droit applicable</H3>
          <Muted>La loi marocaine est applicable. Tout litige relève des tribunaux compétents de Casablanca.</Muted>
        </Card>
      </Grid>
    </Wrap>
  );
}
